	constructor(props:any) {
		super(props);
		this.state;
	}

	componentDidMount() {
		//
	}


	render() {
		return(
			<div className={'tfTxtContainer'}>
				<div id={'imagesContainer'}>

				</div>

				<div id={'tfTxtWorkspace'}>
					<div id={'activeImage'}>
						<canvas> </canvas>
					</div>
				</div>
			</div>
		);
	}
}
